import React from 'react';
import PropTypes from 'prop-types';

const AppLayout = ({ chilrdren }) =>{
    return(
        <div>
            <div>공통메뉴</div>
            {chilrdren}
        </div>
    );
};

AppLayout.prototype= {
    chilrdren: PropTypes.node.isRequired,
};

export default AppLayout
